from typing import List


class Solution:
    def threeSum(self, nums: List[int]) -> List[List[int]]:
        if not nums:
            return []
        
        nums.sort()
        n = len(nums)
        res = set()
        for i, a in enumerate(nums):
            # 让程序飞的关键之一
            if i >= 1 and nums[i] == nums[i-1]:
                continue
            l, r = i+1, n-1
            
            pre_l, pre_r = None, None
            while l < r:
                if l == pre_l:
                    l += 1
                    continue
                if r == pre_r:
                    r -= 1
                    continue
                if nums[l] + nums[r] == -a:
                    res.add(tuple(sorted([a, nums[l], nums[r]])))
                    pre_l, pre_r = l, r
                    l += 1
                    r -= 1
                elif nums[l] + nums[r] < -a:
                    l += 1
                elif nums[l] + nums[r] > -a:
                    r -= 1
        return res

